import React, { Component } from 'react';

class Search extends Component {

  constructor(props) {
    super(props);
    this.state = {
        quote: '',
        data:''
      };
}

componentDidMount() {
  const {data} =[...this.props.data];
      this.setState({data});
}
  findQuote = ( e) => {
    e.preventDefault();

  }

  onChange = e => {
      const value= e.target.value;
    this.setState({ quote: value });
  };

  render() {
      console.log("ser",this.state.data)
    //   if(!this.state || !this.state.data) {
    //     console.log("ser",this.state.data)
    //       return <div>Loading...</div>

    //   }
    return (
            <div>
              <form onSubmit={this.findQuote.bind(this)}>
                <div>
                  <input
                    type="text"
                    name="quote"
                    placeholder="quote"
                    value={this.state.quote}
                    onChange={this.onChange}
                  />
                </div>
                <button
                  type="submit"
                >
                  Search
                </button>
              </form>
            </div>
          );


  }
}

export default Search;
